import TableLoading from "./TableLoading"
import { NFE_DHEMI } from "common/model/Nfe";
import { NFE_EMIT_CPF } from "common/model/Nfe";
import { NFE_EMIT_CNPJ } from "common/model/Nfe";
import { NFE_DEST_CPF } from "common/model/Nfe";
import { NFE_DEST_CNPJ } from "common/model/Nfe";
import { NFE_PLATE } from "common/model/Nfe";
import { NFE_TOTAL_VALUE } from "common/model/Nfe";
import { getNfeATFLink } from "common/enviroment";
import { NFE_KEY } from "common/model/Nfe";
import { Col, Label, Row } from "reactstrap";
import { NFE_STATUS } from "common/model/Nfe";
import { sortData } from "common/utils/collections";
import { convertUtcToBrazilianDate } from "common/utils/validate";
import { cpfOrCnpjThatsTheQuestion } from "common/utils/validate";
import { isEmpty } from "common/utils/collections";
import { manageInputTables } from "common/utils/collections";
import { treatNullValue } from "common/utils/collections";
import { RiNotification2Line } from "react-icons/ri";

export default function NfeTable({ data, headerText, nfeOfInterest, loading, showBell = false, showPlate = false  }) {

    return <div className="content">
        <Row>
            <Col md="12">
                <Label style={{ marginRight: '5px' }}><b>{headerText}</b></Label>
            </Col>
        </Row>
        <Row>
            <Col md="12">
                <TableLoading loading={loading}>
                    <thead className="text-primary">
                        <tr>
                            {showBell && <th></th>}
                            <th>#</th>
                            <th style={{ textAlign: 'center' }}>Data Emissão</th>
                            <th style={{ textAlign: 'right' }}>Emitente</th>
                            <th style={{ textAlign: 'right' }}>Destinatário</th>
                            {showPlate && <th style={{ textAlign: 'center' }}>Placa</th>}
                            <th style={{ textAlign: 'right' }}>Valor</th>
                            <th style={{ textAlign: 'center' }}>Situação</th>
                            <th style={{ textAlign: 'center' }}>Chave da NFe</th>
                        </tr>
                    </thead>
                    <tbody>
                        {!isEmpty(data) && sortData(data, NFE_TOTAL_VALUE).map((nfeData, index) => {

                            return (
                                <tr key={index}>
                                    {showBell &&
                                        <td style={{ paddingBottom: '0px' }}>{
                                            nfeOfInterest === nfeData[NFE_KEY] ?
                                                <p ><RiNotification2Line size={15} /></p>
                                                : ''}
                                        </td>
                                    }
                                    <td>{index}</td>
                                    <td style={{ textAlign: 'center' }}>{convertUtcToBrazilianDate(nfeData[NFE_DHEMI])}</td>
                                    <td style={{ textAlign: 'right' }}>{cpfOrCnpjThatsTheQuestion(nfeData[NFE_EMIT_CPF], nfeData[NFE_EMIT_CNPJ])}</td>
                                    <td style={{ textAlign: 'right' }}>{cpfOrCnpjThatsTheQuestion(nfeData[NFE_DEST_CPF], nfeData[NFE_DEST_CNPJ])}</td>
                                    {showPlate && <td style={{ textAlign: 'center' }}>{treatNullValue(nfeData[NFE_PLATE])}</td>}
                                    <td style={{ textAlign: 'right' }}>R${` ${manageInputTables(nfeData, [NFE_TOTAL_VALUE]).toLocaleString('pt-br', { minimumFractionDigits: 2 })}`}</td>
                                    <td style={{ textAlign: 'center' }}>{treatNullValue(nfeData[NFE_STATUS])}</td>
                                    <td  style={{ textAlign: 'center' }}> <a
                                        style={{ color: '#2322c8' }}
                                        href={getNfeATFLink(nfeData[NFE_KEY])}
                                        target="_blank"
                                        rel="noreferrer"
                                    >
                                        {nfeData[NFE_KEY]}
                                    </a></td>

                                </tr>
                            )
                        })}
                    </tbody>
                </TableLoading>
            </Col>
        </Row>
    </div>

}
